    <script type="text/javascript">
        if (!window.SvgTools) {
            window.SvgTools = {
                editingSvg: {
                    points: [],
                    prevPoints: [],
                },

                assignMapEvents: function () {
                    const svgSource = document.getElementById('svg-source');
                    const polygons = svgSource.getElementsByTagName('polygon');
                    const polylines = svgSource.getElementsByTagName('polyline');

                    for (let i = 0; i < polygons.length; i++) {
                        polygons[i].addEventListener('click', function (e) {
                            SvgTools.addPolygon(this);
                        });
                    }
                    for (let i = 0; i < polylines.length; i++) {
                        polylines[i].addEventListener('click', function (e) {
                            SvgTools.addPolyline(this);
                        });
                    }
                },

                addPolygon(polygon) {
                    const svgPreview = document.getElementById('svg-preview');
                    svgPreview.innerHTML = polygon.outerHTML;

                    const svgCode = document.getElementById('svg-code');
                    svgCode.value = svgPreview.innerHTML;
                },

                addPolyline(polyline) {
                    SvgTools.editingSvg.prevPoints = SvgTools.editingSvg.points;

                    const newPoints = SvgTools.getPoints(polyline.getAttribute('points'));
                    SvgTools.editingSvg.points = SvgTools.joinPoints(SvgTools.editingSvg.points, newPoints, document.getElementById('tools-svg-join-mode').value);

                    const svgPreview = document.getElementById('svg-preview');
                    svgPreview.innerHTML = '<polyline points="' + SvgTools.pointsToStr(SvgTools.editingSvg.points) + '"></polyline>';

                    const svgCode = document.getElementById('svg-code');
                    svgCode.value = svgPreview.innerHTML;
                },

                undo() {
                    SvgTools.editingSvg.points = SvgTools.editingSvg.prevPoints;

                    const svgPreview = document.getElementById('svg-preview');
                    svgPreview.innerHTML = '<polyline points="' + SvgTools.pointsToStr(SvgTools.editingSvg.points) + '"></polyline>';

                    const svgCode = document.getElementById('svg-code');
                    svgCode.value = svgPreview.innerHTML;
                },

                getPoints(str) {
                    const strSpl = str.split(' ');
                    const result = [];
                    for (let i = 0; i <= strSpl.length; i += 2) {
                        const x = strSpl[i];
                        const y = strSpl[i + 1];
                        if (x && y) {
                            result.push({ x: x, y: y });
                        }
                    }
                    return result;
                },

                joinPoints(points1, points2, mode) {
                    if ((points1.length == 0) && (points2.length == 0))
                        return [];
                    if (points1.length == 0)
                        return points2;
                    if (points2.length == 0)
                        return points1;

                    let intersectionPoints = [];
                    let minDistance = 9999;
                    let minDistancePoint;
                    let minDistancePointI2;
                    for (let i1 = 0; i1 < points1.length; i1++) {
                        for (let i2 = 0; i2 < points2.length; i2++) {
                            const dX = points2[i2].x - points1[i1].x;
                            const dY = points2[i2].y - points1[i1].y;
                            const distance = Math.sqrt(dX * dX + dY * dY);
                            if (distance == 0) {
                                intersectionPoints.push(points1[i1]);
                            }
                            else if (distance < minDistance) {
                                minDistance = distance;
                                minDistancePoint = points1[i1];
                                minDistancePointI2 = i2;
                            }
                        }
                    }
                    console.log('intersectionPoints', intersectionPoints);
                    if (intersectionPoints.length == 0) {
                        if (confirm('no intersections (min = ' + minDistance + '), create?')) {
                            points2.splice(minDistancePointI2, 0, minDistancePoint);
                            intersectionPoints.push(minDistancePoint);
                        }
                        else
                            return points1;
                    }
                    if (intersectionPoints.length > 2) {
                        if (confirm('too many intersections (' + intersectionPoints.length + '), get first one?')) {
                            intersectionPoints.splice(1, intersectionPoints.length - 1);
                        }
                        else if (confirm('too many intersections (' + intersectionPoints.length + '), get last one?')) {
                            intersectionPoints = intersectionPoints.reverse();
                            intersectionPoints.splice(1, intersectionPoints.length - 1);
                        }
                        else if (confirm('too many intersections (' + intersectionPoints.length + '), get first two?')) {
                            intersectionPoints.splice(1, intersectionPoints.length - 2);
                        }
                        else if (confirm('too many intersections (' + intersectionPoints.length + '), get last two?')) {
                            intersectionPoints = intersectionPoints.reverse();
                            intersectionPoints.splice(1, intersectionPoints.length - 2);
                        }
                        else
                            return points1;
                    }
                    if (intersectionPoints.length == 2) {
                        if (!confirm('two intersections, create polygon?')) {
                            intersectionPoints.splice(1, 1);
                        }
                    }

                    if (intersectionPoints.length == 1) {
                        const intersectionPoint = intersectionPoints[0];
                        console.log('intersectionPoint', intersectionPoint);

                        const points1BeforeIntersection = [];
                        const points1AfterIntersection = [];
                        let intersectionCrossed = false;
                        for (i = 0; i < points1.length; i++) {
                            if ((points1[i].x == intersectionPoint.x) && (points1[i].y == intersectionPoint.y)) {
                                intersectionCrossed = true;
                                points1BeforeIntersection.push(points1[i]);
                                points1AfterIntersection.push(points1[i]);
                            }
                            else if (!intersectionCrossed) {
                                points1BeforeIntersection.push(points1[i]);
                            }
                            else if (intersectionCrossed) {
                                points1AfterIntersection.push(points1[i]);
                            }
                        }

                        const points2BeforeIntersection = [];
                        const points2AfterIntersection = [];
                        intersectionCrossed = false;
                        for (i = 0; i < points2.length; i++) {
                            if ((points2[i].x == intersectionPoint.x) && (points2[i].y == intersectionPoint.y)) {
                                intersectionCrossed = true;
                                points2BeforeIntersection.push(points2[i]);
                                points2AfterIntersection.push(points2[i]);
                            }
                            else if (!intersectionCrossed) {
                                points2BeforeIntersection.push(points2[i]);
                            }
                            else if (intersectionCrossed) {
                                points2AfterIntersection.push(points2[i]);
                            }
                        }

                        let joinable1;
                        let joinable2;

                        if (points1BeforeIntersection.length == 1) {
                            console.log('joinable1 = points1AfterIntersection');
                            joinable1 = points1AfterIntersection;
                        }
                        else if (points1AfterIntersection.length == 1) {
                            console.log('joinable1 = points1BeforeIntersection');
                            joinable1 = points1BeforeIntersection;
                        }
                        else {
                            console.log('joinable1', { points1BeforeIntersection, points1AfterIntersection });
                            if (mode == 1) {
                                joinable1 = points1BeforeIntersection;
                            }
                            else if (mode == 2) {
                                joinable1 = points1AfterIntersection;
                            }
                            else if (mode == 3) {
                                joinable1 = points1BeforeIntersection;
                            }
                            else if (mode == 4) {
                                joinable1 = points1AfterIntersection;
                            }
                        }

                        if (points2BeforeIntersection.length == 1) {
                            console.log('joinable2 = points2AfterIntersection');
                            joinable2 = points2AfterIntersection;
                        }
                        else if (points2AfterIntersection.length == 1) {
                            console.log('joinable2 = points2BeforeIntersection');
                            joinable2 = points2BeforeIntersection;
                        }
                        else {
                            console.log('joinable2', { points2BeforeIntersection, points2AfterIntersection });
                            if (mode == 1) {
                                joinable2 = points2BeforeIntersection;
                            }
                            else if (mode == 2) {
                                joinable2 = points2BeforeIntersection;
                            }
                            else if (mode == 3) {
                                joinable2 = points2AfterIntersection;
                            }
                            else if (mode == 4) {
                                joinable2 = points2AfterIntersection;
                            }
                        }

                        let result = SvgTools.joinPointsExact(joinable1, joinable2);
                        return result;
                    }
                    else if (intersectionPoints.length == 2) {
                        const intersectionPoint1 = intersectionPoints[0];
                        const intersectionPoint2 = intersectionPoints[1];
                        console.log('intersectionPoint2', { intersectionPoint1, intersectionPoint2 });

                        const points1BetweenIntersections = [];
                        let intersectionCrossed = false;
                        for (i = 0; i < points1.length; i++) {
                            if (((points1[i].x == intersectionPoint1.x) && (points1[i].y == intersectionPoint1.y))
                                || ((points1[i].x == intersectionPoint2.x) && (points1[i].y == intersectionPoint2.y))) {
                                intersectionCrossed = !intersectionCrossed;
                                points1BetweenIntersections.push(points1[i]);
                            }
                            else if (intersectionCrossed) {
                                points1BetweenIntersections.push(points1[i]);
                            }
                        }

                        const points2BetweenIntersections = [];
                        intersectionCrossed = false;
                        for (i = 0; i < points2.length; i++) {
                            if (((points2[i].x == intersectionPoint1.x) && (points2[i].y == intersectionPoint1.y))
                                || ((points2[i].x == intersectionPoint2.x) && (points2[i].y == intersectionPoint2.y))) {
                                intersectionCrossed = !intersectionCrossed;
                                points2BetweenIntersections.push(points2[i]);
                            }
                            else if (intersectionCrossed) {
                                points2BetweenIntersections.push(points2[i]);
                            }
                        }

                        let result = SvgTools.joinPointsExact(points1BetweenIntersections, points2BetweenIntersections);
                        return result;
                    }
                },

                joinPointsExact(points1, points2) {
                    let result = [];
                    if ((points1[points1.length - 1].x == points2[0].x) && (points1[points1.length - 1].y == points2[0].y)) {
                        console.log('joinPointsExact 1');
                        result = points1.concat(points2);
                    }
                    else if ((points1[points1.length - 1].x == points2[points2.length - 1].x) && (points1[points1.length - 1].y == points2[points2.length - 1].y)) {
                        console.log('joinPointsExact 2');
                        result = points1.concat(points2.reverse());
                    }
                    else if ((points1[0].x == points2[points2.length - 1].x) && (points1[0].y == points2[points2.length - 1].y)) {
                        console.log('joinPointsExact 3');
                        result = points1.reverse().concat(points2.reverse());
                    }
                    else if ((points1[0].x == points2[0].x) && (points1[0].y == points2[0].y)) {
                        console.log('joinPointsExact 4');
                        result = points1.reverse().concat(points2);
                    }
                    return result;
                },

                pointsToStr(points) {
                    let result = '';
                    for (let i = 0; i < points.length; i++) {
                        result += ' ' + points[i].x + ' ' + points[i].y;
                    }
                    return result;
                }
            }
        }
        document.addEventListener("DOMContentLoaded", function () {
            SvgTools.assignMapEvents();
        });
    </script>
